const FORMS_API_URL = 'http://localhost:3001/forms';

export const getForms = async () => {
  try {
    const response = await axios.get(FORMS_API_URL);
    return response.data.data;
  } catch (error) {
    console.error('Error fetching forms:', error);
    throw error;
  }
};
